import React from 'react';

const Italic = () => {
  return (
    <svg width="6" height="9" xmlns="http://www.w3.org/2000/svg">
      <text
        transform="translate(-13 -11)"
        fill="#333740"
        fillRule="evenodd"
        fontWeight="500"
        fontSize="13"
        fontFamily="Baskerville-SemiBoldItalic, Baskerville"
        fontStyle="italic"
      >
        <tspan x="13" y="20">
          I
        </tspan>
      </text>
    </svg>
  );
};

export default Italic;
